package javaGitFiles;

import java.util.Scanner;

public class lifeProb {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc = new Scanner(System.in);
		while(true) {
			int T = sc.nextInt();
			if(T!=42) {
				System.out.println(T);
			}
			else break;
		}

	}

}
